醒中毒的妲己，妲己脑中闪过虿盆崖边云溪说的话，愧疚难当。皇后放妲己离去，话里透着玄机。一群神秘黑衣人浩浩荡荡出现在昏迷的君亦辰身边，动机不明。 妲己从黑衣人手中抢回君亦辰。君亦辰在虿盆崖失去过多阳气，妲己为帮他疗伤，去往妖族地界-虹崖。妲己轻车熟路走进一间当铺，一只豹子应声而出。妲己耍诈偷走豹子贴身暗藏的元气珠，豹子暴走。妲己给君亦辰服下元气珠，愤愤不平的申公豹变回人身，带着醋意冷言讥讽妲己，闭门送客。 邓玉带着云溪向师傅请罪，闻太师表示这一世君亦辰不能死，否则黑暗轮回死结无解。云溪自知有罪，将娘娘托付给闻太师，选择自行消散，邓玉泣不成声。无人打扰的妲己二人花前月下互诉衷肠，妲己却无意喊出大王的名字，很受伤的君亦辰表示不想做他人替身，妲己黯然。为打破尴尬，妲己主动道歉并表明自己的心意，君亦辰释然。妲己以想熟悉现代生活为由，拖着君亦辰出门。</span<br />";s:13:"vod_play_from";s:15:"dbm3u8$$$gqm3u8";s:15:"vod_play_server";s:7:"no$$$no";s:13:"vod_play_note";s:3:"$$$";s:12:"vod_play_url";s:1767:"01$https://dbx5.tyswmp.com/20190725/XQFsdttt/index.m3u8#02$https://dbx5.tyswmp.com/20190725/PSESifxi/index.m3u8#03$https://dbx5.tyswmp.com/20190725/v6aJDijt/index.m3u8#04$https://dbx5.tyswmp.com/20190725/qH2EwU4n/index.m3u8#05$https://dbx5.tyswmp.com/20190725/LZGmBMJ9/index.m3u8#06$https://dbx5.tyswmp.com/20190726/q5sC5LYq/index.m3u8#07$https://dbx5.tyswmp.com/20190727/YzSD7fKM/index.m3u8#08$https://dbx5.tyswmp.com/20190802/Ofs0fK4I/index.m3u8#09$https://dbx5.tyswmp.com/20190803/qYkRXhMZ/index.m3u8#10$https://dbx5.tyswmp.com/20190809/VbLb5btA/index.m3u8#11$https://dbx5.tyswmp.com/20190812/2c4sJHC4/index.m3u8#12$https://dbx5.tyswmp.com/20190816/TDm4sboy/index.m3u8#13$https://dbx5.tyswmp.com/20190818/UmSQarbr/index.m3u8#14$https://dbx5.tyswmp.com/20190823/iFZeBE62/index.m3u8#15$https://dbx5.tyswmp.com/20190825/afSLIBPl/index.m3u8#16$https://dbx5.tyswmp.com/20190830/CrZQLflT/index.m3u8$$$01$https://gqnew1.gqzyz.com/20190726/gSAyC4CE/index.m3u8#02$https://gqnew1.gqzyz.com/20190726/AjK82tPg/index.m3u8#03$https://gqnew1.gqzyz.com/20190726/mpW6nmYS/index.m3u8#04$https://gqnew1.gqzyz.com/20190726/V8B9CFG5/index.m3u8#05$https://gqnew1.gqzyz.com/20190726/aEqSeSp3/index.m3u8#06$https://gqnew1.gqzyz.com/20190727/bQU7XXhI/index.m3u8#07$https://gqnew1.gqzyz.com/20190728/rKj1U0Ym/index.m3u8#08$https://gqnew1.gqzyz.com/20190803/xVdr8nO8/index.m3u8#09$https://gqnew1.gqzyz.com/20190804/1cRty0S8/index.m3u8#11$https://gqnew1.gqzyz.com/20190813/ECY6RXAw/index.m3u8#12$h